{
    let dataHash := keccak256(add(data, 32), mload(data))
    let memPtr := mload(64)
    mstore(memPtr, schemaHash)
    mstore(add(memPtr, 32), salt)
    mstore(add(memPtr, 64), expirationTimeSeconds)
    mstore(add(memPtr, 96), gasPrice)
    mstore(add(memPtr, 128), and(signerAddress, 0xffffffffffffffffffffffffffffffffffffffff))
    mstore(add(memPtr, 160), dataHash)
    result := keccak256(memPtr, 192)
}

